import axios from 'axios'
import React, { useEffect, useState } from 'react'

const ShowUsers = () => {
  const [users, setUsers] = useState([])  

  useEffect(() => {
    axios.get("/api/users")
    .then((res)=>res.data)
    .then((users)=>setUsers(users))

  }, [])


  return (
    <></>

  )
}

export default ShowUsers
